type SaveGame = Fable.JsonProvider.Generator<sample>


type Model =
    { input: string
      namesList: string
      priorityNamesList: string
      output: string
      cityNames: string }

type Msg =
    | InputChange of string
    | NamesListChanged of string
    | PriorityNamesListChanged of string
    | CityNamesChanged of string
    | Process

type sav = { Save: SaveGame }
open Elmish


let init () =
    { input = ""+ sample
      output = ""
      namesList = ""
      priorityNamesList = ""
      cityNames = "" },
    Cmd.Empty
let randomizeArray (arr: 'a array) =
    for i in 0 .. arr.Length - 1 do 
            let idx = arr.Length - 1 - i
            let rIdx = int (Math.floor (Math.random () * (float idx)))
            let buf = arr[idx]
            arr[idx] <- arr[rIdx]
            arr[rIdx] <- buf
let update msg model =
    match msg with
    | InputChange str -> { model with input = str }, Cmd.none
    | NamesListChanged str -> { model with namesList = str }, Cmd.none
    | PriorityNamesListChanged str -> { model with priorityNamesList = str }, Cmd.none
    | CityNamesChanged str -> { model with cityNames = str }, Cmd.none
    | Process ->
        let data = model.input.Split "\"name\":\""
        let d1 = (Seq.head data) + "\"name\":\""
        let d2 = Seq.tail data

        let chunks =
            Seq.map
                (fun (x: string) ->
                    Seq.skipWhile (fun y -> y <> '\"') x
                    |> Seq.skip 1
                    |> Seq.toArray
                    |> Seq.map (fun c -> $"{c}")
                    |> String.concat "")
                d2
            |> Seq.map (fun x -> x + "\"name\":\"")
            |> Seq.append [d1]


        let namesarr =
            model.namesList.Split([| ';'; ','; '\r'; '\n' |])
            |> Seq.distinct
            |> Seq.where (fun x -> x.Length > 0)
            |> Seq.toArray
        
        console.log "namesarr"
        let priorityNames =
            model.priorityNamesList.Split([| ';'; ','; '\r'; '\n' |])
            |> Seq.distinct
            |> Seq.where (fun x -> x.Length > 0)
            |> Seq.toArray
        console.log "priority"
        randomizeArray namesarr
        randomizeArray priorityNames
        let names =
            Seq.concat [seq priorityNames; seq namesarr; (Seq.unfold (fun state -> Some("TooManySlots" + (state.ToString()), state + 1)) 0)]
            |> Seq.distinct
            |> Seq.take (Seq.length chunks - 1)
            |> Seq.toArray
        randomizeArray names
        console.log "names"
        
        console.log "randomized"
        let res =
            Seq.zip (chunks |> Seq.rev|> Seq.skip 1|> Seq.rev) names
            |> Seq.map (fun (chunk, name) -> chunk + name + "\"")
            |> String.concat ""
            
        console.log "res"
        let result =
            let x = (res + (Seq.last chunks))
            x.Substring(0, x.Length - 8)
        let cityNamesArr =
            model.cityNames.Split([| ';'; ','; '\r'; '\n' |])
            |> Seq.distinct
            |> Seq.where (fun x -> x.Length > 0)
            |> Seq.toArray
            
        randomizeArray names
        let cityData = result.Split "\"n\":\""
        let cityData1 = (Seq.head cityData) + "\"n\":\""
        let cityData2 = Seq.tail cityData
        let cityDatachunks =
            Seq.map
                (fun (x: string) ->
                    Seq.skipWhile (fun y -> y <> '\"') x
                    |> Seq.skip 1
                    |> Seq.toArray
                    |> Seq.map (fun c -> $"{c}")
                    |> String.concat "")
                cityData2
            |> Seq.map (fun x -> x + "\"n\":\"")
            |> Seq.append [cityData1]
        let citynames =
            Seq.concat [seq cityNamesArr; (Seq.unfold (fun state -> Some("TooManyCities" + (state.ToString()), state + 1)) 0)]
            |> Seq.distinct
            |> Seq.take (Seq.length cityDatachunks - 1)
            |> Seq.toArray
        randomizeArray citynames


        let res2 =
            Seq.zip (cityDatachunks |> Seq.rev|> Seq.skip 1|> Seq.rev) citynames
            |> Seq.map (fun (chunk, name) -> chunk + name + "\"")
            |> String.concat ""
        let result2 =
            let x = (res2 + (Seq.last cityDatachunks))
            x.Substring(0, x.Length - 5)
        { model with output = result2}, Cmd.none

let view (model: Model) dispatch =
    Html.div
        [ prop.style
              [
                  style.width (length.perc 70)
                  style.display.flex
                  style.flexDirection.column
              ]
          prop.children
              [
                Html.div [
                    prop.style [ style.display.flex; style.flexDirection.column ]
                    prop.children [
                        Html.text "save"
                        Html.textarea [
                            prop.type' "text"
                            prop.onChange (fun (x: string) -> dispatch (Msg.InputChange x))
                            prop.value model.input
                            prop.style [ style.color "black" ] ]
                    ]
                ]
                Html.div
                    [ prop.style [ style.display.flex; style.flexDirection.column ]
                      prop.children
                          [ Html.text "names"
                            Html.textarea
                                [ prop.type' "text"
                                  prop.onChange (fun (x: string) -> dispatch (Msg.NamesListChanged x))
                                  prop.value model.namesList
                                  prop.style [ style.color "black" ] ] ] ]
                Html.div
                    [ prop.style [ style.display.flex; style.flexDirection.column ]
                      prop.children
                          [ Html.text "priority Names"
                            Html.textarea
                                [ prop.type' "text"
                                  prop.onChange (fun (x: string) -> dispatch (Msg.PriorityNamesListChanged x))
                                  prop.value model.priorityNamesList
                                  prop.style [ style.color "black" ] ] ] ]
                Html.div
                    [ prop.style [ style.display.flex; style.flexDirection.column ]
                      prop.children
                          [ Html.text "city Names"
                            Html.textarea
                                [ prop.type' "text"
                                  prop.onChange (fun (x: string) -> dispatch (Msg.CityNamesChanged x))
                                  prop.value model.cityNames
                                  prop.style [ style.color "black" ] ] ] ]     
                Html.button [ prop.onClick (fun _ -> dispatch Msg.Process); prop.text "Process" ]
                Html.textarea [
                    prop.style [
                        style.color "black"
                        style.height (length.px 200)
                    ]
                    prop.readOnly true
                    prop.value model.output
                ] ] ]
